    }

    void SetName(string name) {
        name_ = name;
    }

    void SetAge(int age) {
        age_ = age;
    }

    void SetGender(string gender) {
        gender_ = gender;
    }

protected:
    string name_;
    int age_;
    string gender_;
};

class President : public Employer {
public:
    void Print() {
        cout << "Я президент " << endl;
    }
};

class Manager : public Employer {
public:
    void Print() {
        cout << "Я менеджер" << endl;
    }
};

